       &lt;ul&gt;\n         &lt;li&gt; number of tasks: 2609 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 1141.28 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 5.56 s &lt;/li&gt;\n&lt;li&gt; transfer time: 127.47 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.1.178:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 8 &lt;/li&gt;\n          &lt;li&gt; Threads: 192 &lt;/li&gt;\n          &lt;li&gt; Memory: 1.35 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nfrom dask_ml.decomposition import InSituIncrementalPCA\nimport time \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr) #, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr) #, timeout=60, heartbeat_interval=10)\n    return client\n\n\n# Get client\nclient = connect(scheduler_info)\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    \n    pca=InSituIncrementalPCA(n_components=2,copy=False, svd_solver='randomized')\n    print(\"pca, \", pca, flush=True)\n\n    l = pca.fit(gt, [\"t\", \"X\", \"Y\"], [\"X\"], [\"Y\"])\n    #print(\"this is l :\", l, flush=True)\n\n    cpt = [pca.explained_variance_ ,   pca.singular_values_ ]\n    # Submit the task graph to the scheduler\n\n    explained_variance , singular_values = client.persist(cpt)\n    #arrays.validate_contract()   \n    explained_variance , singular_values = client.compute([explained_variance ,singular_values])\n    print(\"explained_variance ,singular_values\",explained_variance.result() ,\" and \" , singular_values.result(), flush=True )\n\nprint(\"Done in \", time.time() -t , \" secondes\")\n    \nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1013","type":"BasicTicker"},{"attributes":{"data":{"bandwidth":{"__ndarray__":"Pw3LhRWvxEFlSYEguzS8QY6liS3xJ8lBj+tw1iUOxEEajNe6n1++QaArWbxc4L1Be4z7mzO6yEHGm1xA2cjFQWKqas8/tcpBBFTSA9myokHkDktUoWzFQWFCF5txF7VBnuwWqe6SyEEZDeshr/eyQY4mJNRzWZhBd1+CReEaw0FGN5tCQmzDQdC1P3+5Z8xBx8/WBIldyEFDmXu2kiu8QXq2k2WYQMFBnpfzNUK8rEGmay64GEaxQT4T/5wkY8dBxq0iMwdKyUHXhiAp/pG8QZ6OFh9xeKNBdtkOZWkMq0HOLDIdsXWgQeIvQx3qIL5BVWReHJrzwkEA6dLWCUq9QcocyEdqmLRBeGNBWwGdokGBsaJt+YZ3QW0azmZV3mBBTvIO8qufwUH8Qhlu2te+Qd6I5K9rT8JB","dtype":"float64","order":"little","shape":[39]},"bandwidth_text":["661.89 MiB","451.30 MiB","804.99 MiB","641.77 MiB","485.98 MiB","478.02 MiB","791.28 MiB","697.11 MiB","854.66 MiB","149.59 MiB","685.58 MiB","337.47 MiB","786.37 MiB","303.48 MiB","97.40 MiB","611.36 MiB","621.53 MiB","908.97 MiB","779.69 MiB","450.72 MiB","552.07 MiB","229.88 MiB","276.38 MiB","748.39 MiB","809.25 MiB","457.12 MiB","155.76 MiB","216.39 MiB","131.68 MiB","482.06 MiB","606.45 MiB","468.63 MiB","329.53 MiB","148.91 MiB","23.53 MiB","8.43 MiB","563.96 MiB","493.49 MiB","585.93 MiB"],"destination":["tcp://172.21.2.181:34410","tcp://172.21.2.181:45049","tcp://172.21.2.182:35405","tcp://172.21.1.
